    var Globally_but_locally$2 = "Little is known about how cyclists move around in cities today. If theres data available, its closed and restricted data sold by one single app provider or static data collected through manual counts. If we want to have more people cycling in cities and make the bicycle as easy and logical to opt for as the car, we also need to get the same data insights into cyclists behavior as we have about car transport.";
