    var Data_content_two$1 = "Les donnes collectes dans ce projet sont des contributions de diffrents types de cyclistes. Toutes les donnes individuelles sont agrges en donnes collectives qui sont donc anonymises. Ces donnes collectives visualisent des traits de comportements des utilisateurs et utilisatrices en montrant comment et o les cyclistes se dplacent  vlo.";
    var Data_content_three$1 = "Les donnes agrges et non-personnelles seront ouvertes au public sous forme de donnes ouvertes. Ces donnes ouvertes, diffuses via The Bike Data Project, peuvent tre utilises par diffrents acteurs et pour diffrentes raisons. Voici une liste non-exhaustive du type dutilisations possible avec ces donnes : ";
    var Data_content_listOne$1 = "Les expert.e.s de la mobilit, de la planification urbaine ou du design urbain ont besoin de donnes ouvertes pour dvelopper des infrastructures modernes et, ainsi, crer des villes durables.";
    var Data_content_listTwo$1 = "Les citoyen.ne.s peuvent visualiser le nombre de cyclistes et le nombre de kilomtres parcourus dans leur ville en regardant la carte.";
