    var Data_content_listFour$1 = "Les entreprises actives dans les donnes peuvent les utiliser pour dvelopper des outils avancs de navigations et de recommandations damlioration de linfrastructure cycliste. Les donnes peuvent tre utile pour tout service ou produit li  lutilisation du vlo.";
    var Data_content_four$1 = "Toutes les donnes agrges et anonymises seront publies comme donnes ouvertes fin Octobre 2020. Contribuez dj vos donnes cyclables au projet !";
    var Map_subtitle$1 = "Voir tout le code open source";
    var About_title$1 = " propos du projet";
    var About_intro$1 = "Avec le Bike Data Project, Open Knowledge Belgium - lorganisation parapluie pour la connaissance ouverte et les donnes ouvertes en Belgique - veut construire une plateforme de donnes ouvertes collectes par les cyclistes et bnficiant aux cyclistes. Le but est dobserver quand et o les cyclistes se dplacent. Ces donnes sont importes grces  des applications diffrentes qui sont connectes  la plateforme du Bike Data Project. Ces donnes ouvertes collectives permettront aux communauts locales de rendre le vlo plus visible et aux pouvoirs publics de crer des villes plus cyclables et vivables.";
    var About_titleOne$1 = "Qui est derrire ce projet ?";
    var About_contentOne_oneBefore$1 = "Le Bike Data Project a initialement t initi par";
    var About_contentOne_oneMiddle$1 = "et lanc dans le cadre de la sortie du";
    var About_contentOne_oneAfter$1 = ", ralis par Fredrik Gertten. Etant donn que ce documentaire ai t projet dans plus de 50 pays, dj plus de 275.000 dplacements  vlo ont t collects.";
    var About_contentOne_twoBefore$1 = "Dbut 2020, le projet a t dplac sous Open Knowledge Belgium.";
    var About_contentOne_twoAfter$1 = "( but non lucratif / vzw / asbl), en tant que section locale d'Open Knowledge International, est une association parapluie pour diverses initiatives de connaissance ouverte et de donnes ouvertes en Belgique. Nous aspirons  un monde dans lequel la connaissance cre du pouvoir pour le plus grand nombre et non pour quelques personnes. Nous faison activement la promotion de l'ouverture  travers des projets et des vnements, au grand public ainsi qu'aux expert.e.s du domaine. En tant qu'organisation parapluie, nous sommes constitus de personnes principalement des bnvoles et passionnes par l'ouverture, utilisant le plaidoyer, la recherche, la technologie et les projets pour dbloquer des informations, permettant aux gens d'utiliser et de partager leurs connaissances.";
    var About_contentOne_three$1 = "Open Knowledge Belgium garantit l'ouverture du projet  toutes fins et prend toutes les mesures ncessaires conformment  la rglementation GDPR concernant la confidentialit et la protection des donnes. Avec des conditions d'utilisation transparentes et claires pour ce projet, Open Knowledge Belgium souhaite montrer l'exemple sur la manire de traiter les problmes lis  la vie prive et souhaite profiter de l'occasion pour informer les citoyens sur leurs droits numriques.";
    var About_titleTwo$1 = "Plus de donnes sur le cyclisme signifie plus dopportunits par et pour les cyclistes";
    var About_contentTwo_one$1 = "On sait peu de choses sur la faon dont les cyclistes se dplacent dans les villes aujourd'hui. S'il y a des donnes disponibles, il s'agit de donnes fermes et restreintes vendues par un seul fournisseur d'application ou de donnes statiques collectes via des comptages manuels. Si nous voulons avoir plus de gens  vlo dans les villes et rendre le vlo aussi simple et logique que la voiture, nous devons galement obtenir les mmes donnes sur le comportement des cyclistes que nous avons sur le transport en voiture.";
    var About_contentTwo_two$1 = "Open Knowledge Belgium vise  crer un impact en montrant o et quand les gens font du vlo. Le Bike Data Project offre la possibilit de collecter toutes les donnes cyclistes de diffrentes applications sur une seule plateforme, qui - base sur le principe de l'open source et des donnes ouvertes - est adaptable et accessible par tous pour garantir quelle profite  la socit dans son entiret.";
    var About_titleThree$1 = "L'infrastructure numrique publique comme bien commun";
    var About_contentThree_one$1 = "Comme pour des activits comme OpenStreetMap Belgium et Open Planner Team d'Open Knowledge Belgium, le Bike Data Project est conu comme un projet collaboratif ouvert  tou.t.es et qui fait bnficier la socit dans son ensemble. Par consquent, l'infrastructure numrique et les donnes agrges, tant bases sur les principes de l'open source et des donnes ouvertes - sont librement adaptables et accessibles  tou.t.es.";
    var About_contentThree_two$1 = "De plus, Open Knowledge Belgium souhaite jouer, avec le Bike Data Project, un rle important dans des mouvements socitaux plus larges :";
    var About_contentThree_listOneBold$1 = "Les citoyen.ne.s peuvent reprendre le contrle de leurs donnes";
    var About_contentThree_listOne$1 = "grce  la forte rglementation europenne GDPR. Dans le cas du Bike Data Project, nous voulons encourager les citoyen.ne.s  extraire leurs donnes d'applications tierces (par exemple des applications populaires comme Strava et mme potentiellement Google Maps) et leur demander de les contribuer  une bonne cause.";
    var About_contentThree_listTwoBold$1 = "Promouvoir le partage des comptences et encourager l'apprentissage au sein de la communaut";
    var About_contentThree_listTwo$1 = "tout au long du processus, de la construction du projet au dveloppement de la plateforme. Fortement inspirs par le travail de la School of Data de Riga, nous souhaitons impliquer la communaut cycliste dans les campagnes locales du Bike Data Project ds le premier jour. Tout au long d'une srie d'vnements, Open Knowledge Belgium souhaite amliorer la matrise des donnes.";
    var About_contentThree_listThreeBold$1 = "Penser globalement, agir localement.";
    var About_contentThree_listThree$1 = "La plateforme Bike Data Project est globale et ouverte par dfaut. Bien qu'il soit possible pour les communauts cyclistes du monde entier de contribuer au projet, Open Knowledge Belgium souhaite soutenir les communauts locales en les faisant agir au niveau local.";
    var About_titleFour$1 = "Durabilit  long terme du Bike Data Project";
    var About_contentFour$1 = "Open Knowledge Belgium s'associe  Bruxelles Mobilit pour lancer, dans le cadre de son programme Bike for Brussels, une premire campagne en Rgion de Bruxelles-Capitale. Le lancement de campagnes locales de crowdsourcing dans diffrentes villes et la mise en place de la plateforme de donnes ouvertes font partie d'un plan  plus long terme pour le Bike Data Project. Lorsqu'une campagne de crowdsourcing dans une ville ou une rgion spcifique prend fin, la plateforme restera en ligne et sera maintenue par la communaut open source d'Open Knowledge Belgium. Les communauts cyclistes d'autres villes seront encourages  lancer une campagne dans leurs villes et  utiliser la plateforme. Compte tenu de l'intrt des diffrentes parties prenantes pour la Bike Data Platform, Open Knowledge Belgium a dj reu la confirmation de diffrentes parties prenantes de leur souhait de contribuer financirement au projet afin que les cots du serveur puissent tre couverts. De cette manire, le projet sera prennis sur le long terme.";
    var Faq_title$1 = "Questions frquemment poses";
    var Question_one_title$1 = "Pourquoi devrais-je participer  ce projet ?";
    var Question_one_answerOne$1 = "En contribuant vos donnes cyclistes, vous pouvez contribuer  rendre nos villes mieux adaptes aux cyclistes.";
    var Question_one_answerTwo$1 = "Plus de donnes sur le cyclisme signifie plus dopportunits par et pour les cyclistes. On sait peu de choses sur la faon dont les cyclistes se dplacent dans les villes aujourd'hui. S'il y a des donnes disponibles, il s'agit de donnes fermes et restreintes vendues par un seul fournisseur d'application, ou de donnes statiques collectes via des comptages manuels. Si nous voulons avoir plus de gens  vlo dans les villes et rendre le vlo aussi simple et logique que la voiture, nous devons galement obtenir les mmes donnes sur le comportement des cyclistes que nous avons sur le transport en voiture.";
    var Question_two_title$1 = "Comment fonctionne ce projet ?";
    var Question_two_answerOne$1 = "Pour faire ce travail, nous avons besoin que vous fournissez vos donnes cyclistes. Nous avons besoin de savoir o vous faites du vlo. Vos contributions de donnes, combines aux donnes de nombreux et nombreuses autres cyclistes, rendront les villes plus adaptes aux cyclistes.";
    var Question_two_answerTwo$1 = "Nous demandons  diffrents types de cyclistes (par exemple, les navetteurs/navetteuses quotidiens, les livreurs/livreuses, les sportifs/sportives et les touristes) denregistrer leurs dplacements  vlo via leur application mobile prfre et de fournir leurs donnes  la plateforme du Bike Data Project. Chaque type de cycliste a quelque chose  apporter  ce projet. Certaines personnes suivent dj leurs activits sportives. C'est super, mais nous voulons aussi vraiment prendre en compte les trajets courts: se rendre au travail, dposer les enfants  l'cole ou en allant  l'picerie du coin.";
    var Question_two_answerThree$1 = "En retour, les donnes cyclistes agrges et anonymises seront ouvertes au public et pourront tre librement utilises par n'importe qui. Nous visons  crer un impact en montrant o et quand les gens font du vlo. Plus de donnes signifie plus d'influence sur les personnes au pouvoir pour rendre les villes plus durables et plus adaptes aux vlos.";
    var Question_three_title$1 = "Comment puis-je contribuer mes donnes  la plateforme ?";
    var Question_three_answer$1 = "Vous pouvez simplement connecter une application cycliste  la plateforme du Bike Data Project. Pour l'instant, vous pouvez soit connecter votre compte Strava, soit tlcharger vos fichiers Garmin, mais nous travaillons galement sur l'intgration d'autres applications. Une fois votre application connecte, vous n'avez plus rien  faire et vos trajets seront automatiquement tlchargs sur la plateforme. Si vous n'utilisez pas encore d'application de cyclisme, vous pourrez bientt utiliser notre propre application. Avec l'application Bike Data Project, vous n'aurez pas besoin de crer de compte : vous pourrez partager anonymement vos donnes sur la plateforme.";
    var Question_four_title$1 = "Que se passe-t-il avec mes donnes ?";
    var Question_four_answerOne$1 = "Les donnes collectes dans le cadre de ce projet sont des contributions de tous types de cyclistes. Toutes les donnes individuelles sont agrges en donnes collectives. Les donnes collectives nous donnent alors des modles que nous pouvons utiliser pour montrer o et quand les cyclistes font du vlo.";
    var Question_four_answerTwo$1 = "Les donnes cyclistes agrges non-prives seront ouvertes au public en tant que donnes ouvertes. Les donnes ouvertes fournies par la plateforme Bike Data Project peuvent tre librement utilises par diffrentes parties prenantes et  des fins diffrentes. Voici une liste non exhaustive des diffrents cas d'utilisation des donnes ouvertes :";
    var Question_four_answerThree$1 = "Les expert.e.s en mobilit et les urbanistes du monde entier ont besoin de donnes ouvertes comme celles-ci pour les aider  dvelopper des infrastructures modernes et des villes durables.";
    var Question_four_answerFour$1 = "Les citoyen.ne.s peuvent avoir un aperu du nombre de cyclistes, des kilomtres parcourus dans la ville et consulter une carte avec le nombre de cyclistes par itinraire.";
    var Question_four_answerFive$1 = "La socit civile et les journalistes peuvent utiliser les donnes pour analyser la situation des cyclistes dans la ville, comme par exemple le temps que les cyclistes attendent en moyenne aux feux de signalisation.";
    var Question_four_answerSix$1 = "Les socits active dans la gestion de donnes et de logiciels peuvent obtenir des informations intelligentes sur le cyclisme et crer des outils tels que des planificateurs d'itinraires cyclables avancs et des moteurs de recommandation pour amliorer l'infrastructure cyclable. Les donnes peuvent galement tre trs utiles pour d'autres produits et services lis au vlo.";
    var Question_four_answerSeven$1 = "Toutes les donnes cyclables agrges seront disponibles sous forme de donnes ouvertes d'ici la fin octobre 2020. Pour l'instant, vous pouvez contribuer au projet en faisant don de vos donnes cyclistes.";
    var Question_five_title$1 = "Ma vie prive est-elle respecte lorsque je communique mes donnes ?";
    var Question_five_answerOne$1 = "Oui, Open Knowledge Belgium garantit l'ouverture du projet afin que la socit en profite dans son ensemble et prend toutes les mesures ncessaires conformment  la rglementation GDPR concernant la confidentialit et la protection des donnes.";
    var Question_five_answerTwo$1 = "Nous collectons des donnes de nombreux cyclistes individuels et visons  rendre les donnes agrges non prives disponibles au public sous forme de donnes ouvertes. Les donnes agrges seront publies de manire  ce qu'il ne soit pas possible de rcuprer les informations personnelles d'une personne.";
    var Question_five_answerThree$1 = "La publication des donnes se fera sur la base du principe de confidentialit diffrentielle, qui est un systme de partage public d'informations sur un ensemble de donnes en dcrivant les modles de groupes au sein de l'ensemble de donnes tout en retenant des informations sur les individus de l'ensemble de donnes. Cela signifie essentiellement que les donnes ne seront publies que si les informations d'une personne particulire ne peuvent pas tre rcupres.";
    var Question_six_title$1 = "Puis-je supprimer mes donnes ?";
    var Question_six_answer$1 = "Oui ! Bien que vous fournissiez vos donnes de manire anonyme (nous ne vous demandons pas votre nom ou toute autre information qui vous identifie), vous pouvez nous demander d'extraire vos donnes de la plateforme Bike Data Project. Veuillez nous envoyer un e-mail  bikedataproject@openknowledge.be avec le nom de l'application que vous avez utilise pour fournir vos donnes et, si possible, galement le numro d'identification associ  votre compte dans l'application.";
